#![feature(test)]
extern crate test;

#[cfg(test)]
mod tests {
    use super::LARGE_STRING2 as LARGE_STRING;
    use test::Bencher;
    use blake2::{Blake2b512, Blake2s256, Digest};

    #[bench]
    fn blake2b512_small_input(b: &mut Bencher) {
        let mut hasher = Blake2b512::new();
        hasher.update(b"Hello world");
        b.iter(|| hasher.clone().finalize());
    }

    #[bench]
    fn blake2s256_small_input(b: &mut Bencher) {
        let mut hasher = Blake2s256::new();
        hasher.update(b"Hello world");
        b.iter(|| hasher.clone().finalize());
    }

    #[bench]
    fn blake3_small_input(b: &mut Bencher) {
        let mut hasher = blake3::Hasher::new();
        hasher.update(b"Hello world");
        b.iter(|| hasher.clone().finalize());
    }

    #[bench]
    fn blake2b512_large_input(b: &mut Bencher) {
        let mut hasher = Blake2b512::new();
        hasher.update(LARGE_STRING.as_bytes());
        b.iter(|| hasher.clone().finalize());
    }

    #[bench]
    fn blake3_large_input(b: &mut Bencher) {
        let mut hasher = blake3::Hasher::new();
        hasher.update(LARGE_STRING.as_bytes());
        b.iter(|| hasher.clone().finalize());
    }
}


pub const LARGE_STRING: &str = "";

pub const LARGE_STRING2: &str = 
"";
